import React from 'react';
import './App.css';
import Order from './components/Order';

class App extends React.Component {
  render() {
    const headphone = {
      id: 102,
      user: 'cena@gmail.com',
      product: 'Razer Headphone',
      price: {
        value: 99.99,
        currency: 'dollars',
      },
    };

    const energyDrink = {
      id: 77,
      user: 'cena@gmail.com',
      product: 'Monster 500mL',
      price: {
        value: 9.99,
        currency: 'dollars',
      },
    };
    return (
      <div className="App">
        <h1>Orders recently created:</h1>
        <p>{(Order = headphone)}</p>
        <p>{(Order = energyDrink)}</p>
      </div>
    );
  }
}

